import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import InputItem from './InputItem';
import { HiArrowRight } from 'react-icons/hi';
import { AiOutlineMail } from 'react-icons/ai';
import { BsTelephone } from 'react-icons/bs';
import { GiAges } from 'react-icons/gi';
import { FaBirthdayCake } from 'react-icons/fa';
import { MdOutlineSchool } from 'react-icons/md';
import { CgWebsite } from 'react-icons/cg';
import 'animate.css';
import './PromptUser.css';

const PromptUser = () => {
    const navigate = useNavigate();
    const [userObject, setUserObject] = useState({
        experience: [{ title: '', company: '', dates: '', location: '', description: [''] }]
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setUserObject(prevState => ({ ...prevState, [name]: value }));
    };

    const handleExperienceChange = (index, e) => {
        const { name, value } = e.target;
        const newExperience = [...userObject.experience];
        newExperience[index][name] = value;
        setUserObject(prevState => ({ ...prevState, experience: newExperience }));
    };

    const handleDescriptionChange = (expIndex, descIndex, e) => {
        const { value } = e.target;
        const newExperience = [...userObject.experience];
        newExperience[expIndex].description[descIndex] = value;
        setUserObject(prevState => ({ ...prevState, experience: newExperience }));
    };

    const addExperience = () => {
        setUserObject(prevState => ({
            ...prevState,
            experience: [...prevState.experience, { title: '', company: '', dates: '', location: '', description: [''] }]
        }));
    };

    const addDescription = (index) => {
        const newExperience = [...userObject.experience];
        newExperience[index].description.push('');
        setUserObject(prevState => ({ ...prevState, experience: newExperience }));
    };

    const onButtonClick = () => {
        navigate('/resume', { state: { userObject } });
    };

    return (
        <div className='prompt-container animate__animated animate__bounce'>
            <div className='inputs'>
                <InputItem className='firstName' onChange={handleChange} label='First Name' placeholder='Enter your first name' name='firstName' />
                <InputItem className='lastName' onChange={handleChange} label='Last Name' placeholder='Enter your last name' name='lastName' />
                <InputItem className='email' onChange={handleChange} label={<AiOutlineMail />} placeholder='Enter your email' name='email' />
                <InputItem className='phone' onChange={handleChange} label={<BsTelephone />} placeholder='Enter phone number' name='phone' />
                <InputItem className='website' onChange={handleChange} label={<CgWebsite />} placeholder='Enter your website' name='website' />
                <InputItem className='location' onChange={handleChange} label='Location' placeholder='Enter your location' name='location' />
                <InputItem className='birth-date' onChange={handleChange} label={<FaBirthdayCake />} type='date' name='DOB' />
                <InputItem className='age' onChange={handleChange} label={<GiAges />} type='number' name='age' placeholder='Enter your age' />
                <InputItem className='skills' onChange={handleChange} label='Skills' name='skills' placeholder='List your skills' />
                <InputItem className='gradYear' onChange={handleChange} label='Graduation Year' name='gradYear' placeholder='Enter your Graduation Year' />
                <InputItem className='certs' onChange={handleChange} label='Certifications' placeholder='Enter your Certifications' name='certs' />
                <InputItem className='uni' onChange={handleChange} label='University' placeholder='Enter University Name' name='uni' />
                <InputItem className='degree' onChange={handleChange} label='Degree' placeholder='Enter Degree' name='degree' />
                <InputItem className='gpa' onChange={handleChange} label='GPA' placeholder='Enter GPA' name='gpa' />
                <InputItem className='profile' onChange={handleChange} label='Summary' placeholder='Enter your summary' name='profile' isTextArea />

                {userObject.experience.map((exp, index) => (
                    <div key={index} className='experience-group'>
                        <InputItem className='title' onChange={(e) => handleExperienceChange(index, e)} label='Title' placeholder='Enter your job title' name='title' />
                        <InputItem className='company' onChange={(e) => handleExperienceChange(index, e)} label='Company' placeholder='Enter company name' name='company' />
                        <InputItem className='dates' onChange={(e) => handleExperienceChange(index, e)} label='Dates' placeholder='Enter employment dates' name='dates' />
                        <InputItem className='location' onChange={(e) => handleExperienceChange(index, e)} label='Location' placeholder='Enter location' name='location' />
                        {exp.description.map((desc, descIndex) => (
                            <InputItem key={descIndex} className='description' onChange={(e) => handleDescriptionChange(index, descIndex, e)} label={`Description ${descIndex + 1}`} placeholder='Enter job description' name={`description${descIndex}`} isTextArea />
                        ))}
                        <button type='button' onClick={() => addDescription(index)}>Add Description</button>
                    </div>
                ))}

                <button className='add-experience-button' type='button' onClick={addExperience}>Add Experience</button>
                <button className='generate-button' onClick={onButtonClick}>
                    Generate Resume <HiArrowRight />
                </button>
            </div>
        </div>
    );
};

export default PromptUser;
